import time

def insertionSort(arr):
    n = len(arr)  
    swaps = 0
    comparisons = 0

    if n <= 1:
        return  #se houver 0 ou 1 elemento, retorna ele mesmo

    start_time = time.time()  

    for i in range(1, n):  # Interage com a lsta a partir do segundo elemento
        key = arr[i] 
        j = i - 1
        while j >= 0 and key < arr[j]:  
            arr[j + 1] = arr[j]  
            swaps += 1
            comparisons += 1
            j -= 1
        arr[j + 1] = key  
        comparisons += 1

    end_time = time.time()  # Grava o tempo final
    sort_time = (end_time - start_time) 

    print(f"Lista Ordenada: {arr}")
    print(f"Tempo de ordenacao: {sort_time} segundos")
    print(f"Quantidade de comparacoes: {comparisons}")
    print(f"Quantidade de trocas: {swaps}")


